import React, {Component} from 'react';
import { render } from '@testing-library/react';

class RandomNumber extends Component {
  state = {
    number: 1
  }

  render(){
    return (
      <div>
        <h1>Number is: {this.state.number}</h1>
      </div>
    )
  }
}

export default RandomNumber;
